}
 




class Date extends React.Component {

  onClickDay=u=>{
    EventTarget.innerHtML="aa";
    console.log(u);
    console.log(EventTarget());
  }

  render() {
    return (
      <Container>
        <Calendar onClickDay={this.onClickDay}
         className="calendar"></Calendar>
      </Container>
    );
  }
}
